INSERT INTO `help_language` (`help_language_id`, `prt_help_id`, `language_id`, `help_question`, `help_answer`, `record_status`, `insert_user`, `insert_date`, `update_user`, `update_date`) VALUES
(1, 1, 1, 'Siteler', ' <ul>\r\n<li style=\"width: 600px; float:left;\">Yeni site eklemek için  <a href=\"?p=sites\" target=\"_self\"> bu sayfadaki</a> \"Yeni site ekle\" butonuna tıklanır.\r\n</li>\r\n                                        <li style=\"width: 600px; float:left;\">Ekenen site şu kurallara uymak zorundadır:</li>\r\n                                        <ul>\r\n                                            <li style=\"width: 600px; float:left;\">http://exemple.com</li>\r\n                                            <li style=\"width: 600px; float:left;\">http://exemple.com</li>\r\n                                            <li style=\"width: 600px; float:left;\">exemple.com</li>\r\n                                        </ul>\r\n                                    </ul>', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(2, 2, 1, 'Sayfa Ekleme Kuralları', '<div class=\"config_line\">\r\n                                        Onaylanmak için, web sitenizin şu kurallara uyması zorunludur:<ul>\r\n                                            <li style=\"width: 400px; float:left;\">Sayfanız 15 saniye içerisinde tam olarak yüklenmelidir.</li>\r\n                                            <li style=\"width: 400px; float:left;\">Duygusal içerikte olmamalıdır.</li>\r\n                                            <li style=\"width: 400px; float:left;\">Pornografik içerik içermemelidir.</li>\r\n                                            <li style=\"width: 400px; float:left;\">\r\n                                                Not have javascript alert.<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\r\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\r\n                                                    <span style=\"width:auto;\">\r\n<img src=\"/wv3/img/fakeflash.jpg\" width=\"281\" height=\"156\" border=\"0\">\r\n</span>\r\n                                                </a>\r\n\r\n                                            </li>\r\n                                            <li style=\"width: 400px; float:left;\">Sistemden çıkmak için onaya ihtiyaç yoktur.<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\r\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\r\n                                                    <span style=\"width:auto;\">\r\n<img src=\"/wv3/img/confirm.jpg\" width=\"641\" height=\"141\" border=\"0\">\r\n</span>\r\n                                                </a>\r\n                                            </li>\r\n                                            <li style=\"width: 400px; float:left;\">Otomatik indirilebilir içerik bulunmamalıdır.</li>\r\n                                            <li style=\"width: 600px; float:left;\">Zararlı yazılım içermemelidir.<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\r\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\r\n                                                    <span style=\"width:auto;\">\r\n<img src=\"/wv3/img/fakeflash02.jpg\" width=\"400\" height=\"244\" border=\"0\">\r\n</span>\r\n                                                </a>\r\n                                            </li>\r\n                                        </ul>\r\n\r\n                                        <div style=\"float:left; width: 600px; margin-top:20px;\">\r\n                                          Bu kurallara uyulmaması, web sitesinin askıya alınmasına neden olacaktır. Websyndic, bu kuralları ihlal eden üyeleri askıya alma hakkını saklı tutar. Eğer kredi satın aldıysanız, kullanılmayan krediler iade edilecektir.</div>\r\n                                    </div>', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(3, 3, 1, 'Ziyaretler', '<div class=\"config_line\">\r\n                                        <span>Ziyaretler site içerisindeki üyelerin <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> ziyaret motorunu</a>kullanmasıyla gerçekleştirilir. Her ziyaret 1 kredidir.<a href=\"#\" class=\"help_link\" id=\"help_link_04\">Kredi</a> kazanmak için, <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> ziyaret motoru </a> kullanılır veya <a href=\"#\" class=\"help_link\" id=\"help_link_06\">kredi satın alınır.</a>.</span>\r\n                                    </div>', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(4, 4, 1, 'Ziyaret Motoru', '  <span>Ziyaret motoru,<a href=\"#\" class=\"help_link\" id=\"help_link_04\"> kredi </a> kazanmanın ücretsiz ve kolay yoludur. Motoru çalıştırmak için, menüde bulunan <a href=\"?p=visio01\" target=\"_self \" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_credit\"> \"Kredi Kazan\" </a> linkine tıklayarak açılan sayfadaki motoru çalıştırmalısınız.  Her ne zaman motoru kullanırsanız , ziyaret edilen sayfa başına 0.8 <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> kredi </a> </span> kazanırsınız.\r\n                                ', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(5, 5, 1, 'Krediler', '<span>Krediler WebSyndic sisteminin para birimidir. Her  <a href=\"#\" class=\"help_link\" id=\"help_link_03\"> ziyaret </a> bedeli 1 kredidir. Her ne zaman  the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> ziyaret motoru </a>kullanırsanız, ziyaret başına 0.8 <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> kredi</a> kazanırsınız. Daha fazla kredi kazanmak isterseniz <a href=\"#\" class=\"help_link\" id=\"help_link_07\"> referans linki  </a> kullanarak arkadaşlarınızı da kullanabilirsiniz </span>.\r\n                               ', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(6, 6, 1, 'Kredi Satın Almak', '  <span>Görüntüleyen, ihtiyaçlarınıza göre yeterli kredi üretemezseniz, siteleriniz için kredi satın alabilirsiniz. Böylelikle sitelerinize fazla ziyaretçi çekebilirsiniz. Paypal sistemi veya banka/kredi kartıyla size uygun şekilde kredi satın alabilir, para birimi olarak Euro ya da Dolar şeklinde seçebilirsiniz. Krediler <a href=\"buy\"> bu </a> sayfadan satın alınabilir</span>\r\n                             ', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(7, 7, 1, 'Sponsorluk', '<span>Referans bağlantıyı kullanarak arkadaşlarının kazandığı kredilerinin %10\'unu sizde kazanırsınız.</span>', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(8, 1, 2, 'Sites', ' <ul>\r\n<li style=\"width: 600px; float:left;\">To add a website you must click on \"Add Site\" on <a href=\"?p=sites\" target=\"_self\"> this page</a>\r\n</li>\r\n                                        <li style=\"width: 600px; float:left;\">The site must be added using this format:</li>\r\n                                        <ul>\r\n                                            <li style=\"width: 600px; float:left;\">http://exemple.com</li>\r\n                                            <li style=\"width: 600px; float:left;\">http://exemple.com</li>\r\n                                            <li style=\"width: 600px; float:left;\">exemple.com</li>\r\n                                        </ul>\r\n                                    </ul>', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(9, 2, 2, 'Rules for Adding Sites', '<div class=\"config_line\">\r\n                                        To get approved, your website must:<ul>\r\n                                            <li style=\"width: 400px; float:left;\">Get fully loaded within 15 seconds</li>\r\n                                            <li style=\"width: 400px; float:left;\">Not have heinous content</li>\r\n                                            <li style=\"width: 400px; float:left;\">Not have pornographic content</li>\r\n                                            <li style=\"width: 400px; float:left;\">\r\n                                                Not have javascript alert.<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\r\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\r\n                                                    <span style=\"width:auto;\">\r\n<img src=\"/wv3/img/fakeflash.jpg\" width=\"281\" height=\"156\" border=\"0\">\r\n</span>\r\n                                                </a>\r\n\r\n                                            </li>\r\n                                            <li style=\"width: 400px; float:left;\">Not require confirmation to exit.<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\r\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\r\n                                                    <span style=\"width:auto;\">\r\n<img src=\"/wv3/img/confirm.jpg\" width=\"641\" height=\"141\" border=\"0\">\r\n</span>\r\n                                                </a>\r\n                                            </li>\r\n                                            <li style=\"width: 400px; float:left;\">Not have automatic downloads.</li>\r\n                                            <li style=\"width: 600px; float:left;\">Not redirect to Spyware / Malware / Virus sites<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\r\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\r\n                                                    <span style=\"width:auto;\">\r\n<img src=\"/wv3/img/fakeflash02.jpg\" width=\"400\" height=\"244\" border=\"0\">\r\n</span>\r\n                                                </a>\r\n                                            </li>\r\n                                        </ul>\r\n\r\n                                        <div style=\"float:left; width: 600px; margin-top:20px;\">\r\n                                            Failure to comply with these rules will result in the website suspension. Websyndic reserves the right to suspend members who violate these rules. If you purchased credits, unused credits will be refunded.</div>\r\n                                    </div>', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(10, 3, 2, 'Visits', '<div class=\"config_line\">\r\n                                        <span>The visits are generated by members who use <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> the viewer</a>. Each visit costs 1 <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credit</a>. To get <a href=\"#\" class=\"help_link\" id=\"help_link_04\">credits</a>, you must either use the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer </a> or <a href=\"#\" class=\"help_link\" id=\"help_link_06\"> buy credits.</a>.</span>\r\n                                    </div>', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(11, 4, 2, 'Viewer', '  <span>The viewer is the free and easy way to earn <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credit </a>. To start the viewer, you must click <a href=\"?p=visio01\" target=\"_self \" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_credit\"> Earn Credits </a> located in the menu <a href=\"?p=visio01\" target=\"_self\" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_credit\"> at left of the website. </a> Whenever you visit the site of another member using the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer </a>, you will earn 0.8 <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credit </a> </span>.\r\n                                ', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(12, 5, 2, 'Credits', '<span>Credits are the Websyndic currency. Each <a href=\"#\" class=\"help_link\" id=\"help_link_03\"> visit </a> cost 1 credit. Whenever you visit the site another member using the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer </a>, you will earn 0.8 <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credit</a>. If the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer </a> does not meet your needs, you can <a href=\"#\" class=\"help_link\" id=\"help_link_06\"> buy credits </a>. You can also earn extra credit by sharing your <a href=\"#\" class=\"help_link\" id=\"help_link_07\"> referal link </a> on your site </span>.\r\n                               ', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(13, 6, 2, 'Purchasing Credits', '  <span>If the viewer does not generate enough <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credits </a> for your needs, you can increase the number of <a href=\"#\" class=\"&#8203;&#8203;help_link\" id=\"help_link_03\"> visits </a> received each day on your site buying <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credits</a>. We offer several convenient payment options: SMS (Allopass) or by debit or credit card (Paypal). You can choose the currency - Euro or Dollars (U.S.) - whichever suits you best. The <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credits </a> are available for purchase on <a href=\"?p=buy\" target=\"_self\" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_buy\"> this page</a></span>\r\n                             ', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00'),
(14, 7, 2, 'Sponsorship', '<span>You earn 10% of all <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credits </a> that members registered using your referal link earn with the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer</a>. All referral information is available on <a href=\"?p=ref\" target=\"_self\" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_ref\"> this page </a> </span>', 1, 0, '2017-01-20 00:00:00', 0, '2017-01-20 00:00:00');
