INSERT INTO `prt_help` (`prt_help_id`, `help_question`, `help_answer`, `help_status`, `record_status`, `insert_user`, `insert_date`, `update_user`, `update_date`) VALUES
(1, 'Sites', ' <ul>\n<li style=\"width: 600px; float:left;\">To add a website you must click on \"Add Site\" on <a href=\"?p=sites\" target=\"_self\"> this page</a>\n</li>\n                                        <li style=\"width: 600px; float:left;\">The site must be added using this format:</li>\n                                        <ul>\n                                            <li style=\"width: 600px; float:left;\">http://exemple.com</li>\n                                            <li style=\"width: 600px; float:left;\">http://exemple.com</li>\n                                            <li style=\"width: 600px; float:left;\">exemple.com</li>\n                                        </ul>\n                                    </ul>', 'in', 1, 0, '2017-01-16 00:00:00', 0, '2017-01-16 00:00:00'),
(2, 'Rules for Adding Sites', '<div class=\"config_line\">\n                                        To get approved, your website must:<ul>\n                                            <li style=\"width: 400px; float:left;\">Get fully loaded within 15 seconds</li>\n                                            <li style=\"width: 400px; float:left;\">Not have heinous content</li>\n                                            <li style=\"width: 400px; float:left;\">Not have pornographic content</li>\n                                            <li style=\"width: 400px; float:left;\">\n                                                Not have javascript alert.<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\n                                                    <span style=\"width:auto;\">\n<img src=\"/wv3/img/fakeflash.jpg\" width=\"281\" height=\"156\" border=\"0\">\n</span>\n                                                </a>\n\n                                            </li>\n                                            <li style=\"width: 400px; float:left;\">Not require confirmation to exit.<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\n                                                    <span style=\"width:auto;\">\n<img src=\"/wv3/img/confirm.jpg\" width=\"641\" height=\"141\" border=\"0\">\n</span>\n                                                </a>\n                                            </li>\n                                            <li style=\"width: 400px; float:left;\">Not have automatic downloads.</li>\n                                            <li style=\"width: 600px; float:left;\">Not redirect to Spyware / Malware / Virus sites<a href=\"#\" class=\"pop_box\" style=\"float:none;\">\n                                                    <img src=\"/wv3/img/interogation.png\" width=\"12\" height=\"12\" border=\"0\">\n                                                    <span style=\"width:auto;\">\n<img src=\"/wv3/img/fakeflash02.jpg\" width=\"400\" height=\"244\" border=\"0\">\n</span>\n                                                </a>\n                                            </li>\n                                        </ul>\n\n                                        <div style=\"float:left; width: 600px; margin-top:20px;\">\n                                            Failure to comply with these rules will result in the website suspension. Websyndic reserves the right to suspend members who violate these rules. If you purchased credits, unused credits will be refunded.</div>\n                                    </div>', 'collapse', 1, 0, '2017-01-16 00:00:00', 0, '2017-01-16 00:00:00'),
(3, 'Visits', '<div class=\"config_line\">\n                                        <span>The visits are generated by members who use <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> the viewer</a>. Each visit costs 1 <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credit</a>. To get <a href=\"#\" class=\"help_link\" id=\"help_link_04\">credits</a>, you must either use the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer </a> or <a href=\"#\" class=\"help_link\" id=\"help_link_06\"> buy credits.</a>.</span>\n                                    </div>', 'collapse', 1, 0, '2017-01-16 00:00:00', 0, '2017-01-16 00:00:00'),
(4, 'Viewer', '  <span>The viewer is the free and easy way to earn <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credit </a>. To start the viewer, you must click <a href=\"?p=visio01\" target=\"_self \" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_credit\"> Earn Credits </a> located in the menu <a href=\"?p=visio01\" target=\"_self\" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_credit\"> at left of the website. </a> Whenever you visit the site of another member using the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer </a>, you will earn 0.8 <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credit </a> </span>.\n                                ', 'collapse', 1, 0, '2017-01-16 00:00:00', 0, '2017-01-16 00:00:00'),
(5, 'Credits', '<span>Credits are the Websyndic currency. Each <a href=\"#\" class=\"help_link\" id=\"help_link_03\"> visit </a> cost 1 credit. Whenever you visit the site another member using the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer </a>, you will earn 0.8 <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credit</a>. If the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer </a> does not meet your needs, you can <a href=\"#\" class=\"help_link\" id=\"help_link_06\"> buy credits </a>. You can also earn extra credit by sharing your <a href=\"#\" class=\"help_link\" id=\"help_link_07\"> referal link </a> on your site </span>.\n                               ', 'collapse', 1, 0, '2017-01-16 00:00:00', 0, '2017-01-16 00:00:00'),
(6, 'Purchasing Credits', '  <span>If the viewer does not generate enough <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credits </a> for your needs, you can increase the number of <a href=\"#\" class=\"&#8203;&#8203;help_link\" id=\"help_link_03\"> visits </a> received each day on your site buying <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credits</a>. We offer several convenient payment options: SMS (Allopass) or by debit or credit card (Paypal). You can choose the currency - Euro or Dollars (U.S.) - whichever suits you best. The <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credits </a> are available for purchase on <a href=\"?p=buy\" target=\"_self\" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_buy\"> this page</a></span>\n                             ', 'collapse', 1, 0, '2017-01-16 00:00:00', 0, '2017-01-16 00:00:00'),
(7, 'Sponsorship', '<span>You earn 10% of all <a href=\"#\" class=\"help_link\" id=\"help_link_04\"> credits </a> that members registered using your referal link earn with the <a href=\"#\" class=\"help_link\" id=\"help_link_04a\"> viewer</a>. All referral information is available on <a href=\"?p=ref\" target=\"_self\" class=\"help_link_menu_btn\" id=\"help_link_menu_btn_ref\"> this page </a> </span>', 'collapse', 1, 0, '2017-01-16 00:00:00', 0, '2017-01-16 00:00:00');
